import React from "react";
import styled from "styled-components";

const TimerWrapper = styled.h1`
  position: relative;
  width: 300px;
  color: #f05550;
`;


class Timer extends React.PureComponent {
  render(){
  return (
    <TimerWrapper>
        TOMATO 25:00
    </TimerWrapper>
  );
  }
};
export default Timer;
